Set this property to be irreflexive. This means that no individual is connected by this property to itself. For example, the property
<i>a:marriedTo</i> is irreflexive since nobody can be married to themselves. 
@see #setReflexive()

Set this property to be reflexive. This means that each individual is connected by this property to itself. For example, the property
<i>a:knows</i> is reflexive since everybody knows themselves. 
@see #setIrreflexive()

