The Ontology Management mainly serves two purposes:
<ol>
	<li>Management of ontologies</li>
	<li>Providing a global view on all ontological information</li>
</ol>
&lt;p&gt; The management of {@link Ontology ontologies} is achieved by providing methods to {@link #register(org.universAAL.middleware.container.ModuleContext, Ontology) register} and {@link #unregister(org.universAAL.middleware.container.ModuleContext, Ontology) unregister} an ontology as well as to query information about ontologies, i.e. to get a list of URIs of all registered ontologies with {@link #getOntoloyURIs()} and to get a specific ontology with {@link #getOntology(String)}.
&lt;/p&gt;
&lt;p&gt; To add a new ontology, the method {@link Ontology#create()} has to be overwritten and the ontology needs to be registered by calling {@link #register(org.universAAL.middleware.container.ModuleContext, Ontology)} . The ontology is then added to the internal list of <i>pending</i> ontologies. That means, that the information of the ontology is available for some special methods (e.g. {@link #isRegisteredClass(String, boolean)}) to provide the possibility to create instances of the classes of that ontology. Then, the &lt;code&gt;create()&lt;/code&gt; method is called to actually create all this information. If &lt;code&gt;create()&lt;/code&gt; returns without errors, the ontology is removed from the list of <i>pending</i> ontologies and is then available in the system.
&lt;/p&gt;
&lt;p&gt; Ontological information can be distributed in different ontologies, e.g. one ontology can define a class and a different ontology can extend this class by adding some properties. The second purpose of the {@link OntologyManagement} is to provide a combined view on all this information as if all was defined in only one ontology.
&lt;/p&gt;
&lt;p&gt; {@link OntologyManagement} implements the <i>Singleton</i> design pattern. To get an instance of this class and be able to call the methods, call {@link #getInstance()}.
&lt;/p&gt;

