Returns true if the given object is a member of the class represented by this class expression, otherwise false. The <code>context</code> table maps the URIs of certain variables onto values currently assigned to them. The variables are either standard variables managed by the universAAL middleware or parameters of a specific service in whose context this method is called. Both the object whose membership is going to be checked and this class expression may contain references to such variables. If there is already a value assigned to such a referenced variable, it must be replaced by the associated value, otherwise this method may expand the <code>context</code> table by deriving a value for such unassigned but referenced variables with which the membership can be asserted. In case of returning true, the caller must check the size of the <code>context</code> table to see if new conditions are added in order for the membership to be asserted. If the <code>context</code> table is null, the method does a global and unconditional check. 
@see org.universAAL.middleware.util.Constants#VAR_uAAL_ACCESSING_BUS_MEMBER
@see org.universAAL.middleware.util.Constants#VAR_uAAL_ACCESSING_HUMAN_USER
@see org.universAAL.middleware.util.Constants#VAR_uAAL_CURRENT_DATETIME
@see org.universAAL.middleware.util.Constants#VAR_uAAL_SERVICE_TO_SELECT

