<code>context</code> table maps the URIs of certain variables onto values currently assigned to them. The variables are either standard variables managed by the universAAL middleware or parameters of a specific service in whose context this method is called. Both of the class expressions may contain references to such variables. If there is already a value assigned to such a referenced variable, it must be replaced by the associated value, otherwise this method may expand the
<code>context</code> table by deriving a value for such unassigned but referenced variables with which the disjointness of the two classes can be asserted. In case of returning true, the caller must check the size of the <code>context</code> table to see if new conditions are added in order for the disjointness to be asserted. If the <code>context</code> table is null, the method does a global and unconditional check. 
